import React from "react";
import Song from "../data/songs.json";

class Opdracht4 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        }
    }
        
    render() {
        return (
          <div>
            <table>
              <tr>
                <th>Artist</th>
                <th>Title</th>
              </tr>
              {
              Song.map((Song) => {
                return (
                  <tr>
                    <td>{Song.artist}</td>
                    <td>{Song.title}</td>
                  </tr>
                );
              })
              }
            </table>
          </div>
        );
      }
}

export default Opdracht4;
